import React from 'react';
import { View , Text, StyleSheet } from 'react-native';

const Logout = () => {
    return (
        <View style={StyleSheet.logout_div}>
            <Text>LogOut</Text>
        </View>
    )
}

const styles = StyleSheet.create({
    logout_div : {
        flex :1,
        width:"100%",
        justifyContent : 'center',
        alignItems : 'center'
    }
})

export default Logout
